import postRequestMultipartFormData from '../../../../common/api/post/postRequestMultipartFormData';

const deleteCategory = '/delete-category';

async function postDeleteCategory(id, updateAfterDelete) {
  const payload = {
    data: {
      id,
    },
  };

  try {
    const response = postRequestMultipartFormData(deleteCategory, payload);
    const result = response.data;
    updateAfterDelete();
    return result;
  } catch (error) {
    return null;
  }
}

export default postDeleteCategory;
